        private static GuildBounty SetName(this GuildBounty bounty, string name)
        {
            bounty.Name = name;
            return bounty;
        }

        private static GuildBounty SetMapId(this GuildBounty bounty, int map_id)
        {
            bounty.MapId = map_id;
            return bounty;
        }

        private static GuildBounty AddPath(this GuildBounty bounty, double[,] points, PathDirectionType direction = PathDirectionType.Invalid)
        {
            if (bounty.Paths == null)
                bounty.Paths = new List<GuildBountyPath>();

            GuildBountyPath path = new GuildBountyPath() { Direction = direction };
            
            path.Points = new List<List<double>>();
            for (int i = 0; i*2 < points.Length; i++)
                path.Points.Add(new List<double> { points[i, 0], points[i, 1] });

            bounty.Paths.Add(path);

            return bounty;
        }

        private static GuildBounty AddSpawns(this GuildBounty bounty, double[,] points)
        {
            if (bounty.Spawns == null)
                bounty.Spawns = new List<List<double>>();

            for (int i = 0; i * 2 < points.Length; i++)
                bounty.Spawns.Add(new List<double> { points[i, 0], points[i, 1] });

            return bounty;
        }
    }
